import React from 'react';
import history from '../../history';

import './Home.css';

class Home extends React.Component {

    constructor(props) {
        super(props);
        this.history = useHistory();
    }

    handleClick() {
        this.history.push('/game');
    }

    render() {
        return (
            <div className="Home">
                Home
                <br />
                <button onClick={this.handleClick}>
                    go to Game
                </button>
            </div>
        );
    }
}

export default Home;
